import React from 'react';
import styled from 'styled-components';

function Login() {
  return (
    <Container>
    <Logo>
        <img src="logo.png" alt="" />
    </Logo>
    </Container>
  )
}
const Container = styled.div`
    width : 100%;

`;

export default Login
